const bindMouseEventListeners = (elementId, div, n) => {
  const getX = (region, x) => {
    const id = `p${hash(`${elementId}${region}${x}`)}`;
    return d3.select(`#${id}`);
  };

  let startTime;
  let endTime;

  div
    .on('mouseover', function onMouseover() {
      const node = d3.select(this);
      const nodeShaded = node.attr('shaded') || NOT_SHADED;

      node.style('cursor', 'pointer');
      node.attr('fill-opacity', 0.2);

      if (nodeShaded === NOT_SHADED) {
        node.attr('fill', '#009fdf');
      } else if (nodeShaded === IDENTIFIER_FOR_BLACK) {
        node.attr('fill', '#000000');
      } else if (nodeShaded === IDENTIFIER_FOR_RED) {
        node.attr('fill', '#ff0000');
      }
    })
    .on('mouseout', function onMouseout() {
      const node = d3.select(this);
      const nodeShaded = node.attr('shaded') || NOT_SHADED;
      if (nodeShaded === null) {
        node.attr('shaded', NOT_SHADED);
      }

      node.style('cursor', 'default');

      if (nodeShaded === NOT_SHADED) {
        node.attr('fill', '#ffffff');
        node.attr('fill-opacity', 0.2);
      } else if (nodeShaded === IDENTIFIER_FOR_BLACK) {
        node.attr('fill', '#000000');
        node.attr('fill-opacity', 1);
      } else if (nodeShaded === IDENTIFIER_FOR_RED) {
        node.attr('fill', '#ff0000');
        node.attr('fill-opacity', 1);
      }
    })
    .on('mousedown', function onMousedown() {
      startTime = new Date();
    })
    .on('mouseup', function onMousedown() {
      endTime = new Date();
      const node = d3.select(this);
      const nodeShaded = node.attr('shaded') || NOT_SHADED;
      const nodeRegion = node.attr('id');
      const nodeX = node.attr('x') || -1;

      if (nodeShaded === NOT_SHADED) {
        node.attr('fill', '#000000');
        node.attr('fill-opacity', 1);
        node.attr('shaded', IDENTIFIER_FOR_BLACK);
      } else if (nodeShaded === IDENTIFIER_FOR_BLACK) {
        const x = getX(nodeRegion, 0);
        x.attr('fill-opacity', 1);

        node.attr('fill', '#ff0000');
        node.attr('fill-opacity', 1);
        node.attr('x', 0);
        node.attr('shaded', IDENTIFIER_FOR_RED);
      } else if (nodeShaded === IDENTIFIER_FOR_RED) {
        if (((endTime - startTime) > 200)) {
          const nextX = (parseInt(nodeX, 10) + 1) % n;
          const x = getX(nodeRegion, nextX);
          const x2 = getX(nodeRegion, nodeX);
          x.attr('fill-opacity', 1);
          x2.attr('fill-opacity', 0);

          node.attr('x', nextX);
        } else {
          const x = getX(nodeRegion, nodeX);
          x.attr('fill-opacity', 0);

          node.attr('fill', '#ffffff');
          node.attr('fill-opacity', 0.2);
          node.attr('x', -1);
          node.attr('shaded', NOT_SHADED);
        }
      }
    });
}

function drawPaths(elementId, diagram, paths, mouseEventListener, n) {
  const { REGION, X } = PATH_TYPES;
  paths.forEach((pathEntry) => {
    const { name, path, xPaths } = pathEntry;
    const appendedPath = diagram.append('path');

    appendedPath
      .attr('d', path)
      .attr('id', name)
      .attr('fill', 'white')
      .attr('fill-opacity', 0.2)
      .attr('path-type', REGION);

    xPaths.forEach((xPath, idx) => {
      const appendedXPath = diagram.append('path');
      const id = `p${hash(`${elementId}${name}${idx}`)}`;
      appendedXPath
        .attr('d', xPath)
        .attr('id', id)
        .attr('fill', 'white')
        .attr('fill-opacity', 0)
        .attr('path-type', X);
    });

    if (mouseEventListener) {
      bindMouseEventListeners(elementId, appendedPath, n);
    }
  });
}

function createCircularVennDiagram(
  elementId,
  width,
  height,
  circles,
  paths,
  mouseEventListener,
  n,
) {
  function drawCircle(diagram, cX, cY, id) {
    diagram.append('circle')
      .attr('fill-opacity', 0)
      .attr('stroke', 'blue')
      .attr('stroke-width', 1)
      .attr('opacity', 1)
      .attr('fill', '#ffffff')
      .attr('r', 80)
      .attr('cx', cX)
      .attr('cy', cY)
      .attr('id', id);
  }
  const div = d3.select(`#${elementId}`);
  const diagram = div.append('svg').attr('width', width).attr('height', height);

  circles.forEach((circle) => {
    const {
      cX,
      cY,
      id,
    } = circle;
    drawCircle(diagram, cX, cY, id);
  });

  drawPaths(elementId, diagram, paths, mouseEventListener, n);

  return div;
}

